  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Sheldon NWR for the next 15 years. This plan
  outlines the Refuge vision and purpose and describes how Sheldon NWR will contribute
  to the overall mission of the Refuge System. The plan provides an introduction to
  the Refuge; information about the physical, biological, and social environment;
  goals and objectives; alternatives; and environmental consequences. Key planning
  issues include: feral horses, juniper encroachment, wildland fire, invasive species,
  fishing, camping, wilderness review, and public access.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
